import Item from "./Item.js";

const List = ({
  add,
  listData,
  deleteData,
  submittingstatus,
  finishedTask,
  setFinish,
}) => {
  const [overStatus, setOverstatus] = useState(false);

  return (
    <div className="pt-10 text-white">
      {overStatus === false ? (
        <div>
          {JSON.stringify(listData)}

          {listData.map((item) => {
            const { id, note, date, time } = item;
            return (
              <Item
                key={id}
                id={id}
                note={note}
                date={date}
                time={time}
                deleteData={deleteData}
                submittingstatus={submittingstatus}
                add={add}
                listData={listData}
                item={item}
                finish={finishedTask}
                setFinish={setFinish}
                overStatus={overStatus}
                setOverstatus={setOverstatus}
              />
            );
          })}
        </div>
      ) : (
        <div>
          <p className="text-3xl font-bold sm:text-3xl lg:mt-6 tracking-tight">
            Finished Tasks :
          </p>
          {JSON.stringify(finishedTask)}
        </div>
      )}
    </div>
  );
};

export default List;
